import React from "react";
import './Result.css';
import './OneHash'

import Header from "./Header";

function getPWD(){ //récupération du mot de passe
    return localStorage.getItem("pwd"), localStorage.getItem("time"),localStorage.getItem("alert");
}

function Result() {
    var pwd,time,alert = getPWD();
    return (
        <div className="App">
            <Header/>
        <header className="App-heade">
            <h2>PASSWORD FOUND</h2>
            <p>The result is : </p>
            {pwd}
            {time}
            {alert}
        </header>
        </div>
    );
}

export default Result;
